@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url("http://www.google.com/"),
url-prefix("http://www.google.com/search"),
url-prefix("http://www.google.com/webhp"),
domain("images.google.com"),
url-prefix("http://images.google.com/images"),
domain("news.google.com"),
url-prefix("http://news.google.com/news"),
url-prefix("http://www.google.com/prdhp"),
url-prefix("http://www.google.com/products") {
* {
background-color:#000 !important;
color:#FFF !important;
}

input {color:#808080 !important;}

#logo * {display:none !important;}
#logo {text-indent:-999px !important;}

.csb, .n div, #glogo, #logo, #wml .wml, .w10, .w20, .wmi, .wci, .wpb {
background-color:transparent !important;
background-image:url(data:image/gif;base64,) !important;
background-repeat:no-repeat !important;
}

a {
text-decoration:none !important;
}
#gbar a, #guser a, a:link, a:link * {
color:#99F !important;
}
#gbar, #guser {
color:white !important;
}
.gbh {
border-top:white solid 1px !important;
}

#logo {
background-position: 0pt -26px !important;
}

input {
border:#FFF solid 1px !important;
padding:3px 5px !important;
}
input[type=submit] {
padding:2px 3px !important;
}

a:visited, a:visited * {
color:#636 !important;
}

cite {
color:#0C0 !important;
}
cite b {
color:#9F9 !important;
}

#tads {
-moz-opacity:.4 !important;
}
#mbEnd {
border-left-color:black !important;
background:#000 !important;
}
#rhsline {border-color:black !important;}

.bt {
border:solid #99F !important;
border-width:1px 0 !important;
}

.w10 {
background-position:-152px 0px !important;
}
.w20 {
background-position:-152px -32px !important;
}
.wmi {
background-position:-114px -90px !important;
}
.wci {
background-position:-97px -105px !important;
}
.wpb {
background-position:-114px -78px !important;
}

#nf {
background-position: -26px 0pt !important;
}
#nc{
background-position: -44px 0pt !important;
}
.n .nr {
background-position: -60px 0pt !important;
}
#nn {
background-position: -76px 0pt !important;
}

/* Google Suggest, inserted by Customize Google extension */
#completeTable {
border:#FFF solid 1px !important;
}
}

/* Google home page */
@-moz-document url("http://www.google.com/"), url-prefix("http://www.google.com/webhp") {
center {
background-image: url(data:image/jpeg;base64,) !important;
background-repeat: no-repeat !important;
background-position: center 25px !important;
}

img[alt="Google"] {
visibility:hidden !important;
}

input[type="submit"] {
margin:6px 3px !important;
}
}

/* Google Image search home */
@-moz-document url-prefix("http://images.google.com/imghp") {
img[alt="Google"] {
visibility: hidden !important;
}

center {
background-image: url(data:image/jpeg;base64,) !important;
background-repeat: no-repeat !important;
background-position: center 25px !important;
}
}
/* Google Image search pages */
@-moz-document url-prefix("http://images.google.com/images") {
select {
border:#fff solid 1px !important;
}
}

/* Google News pages */
@-moz-document domain("news.google.com") {
img[alt*="Google News Home"] {
visibility:hidden !important;
}
a[linkindex="20"] img {
visibility: hidden !important;
}
a[linkindex="20"] {
background-image: url(data:data:image/jpeg;base64,) !important;
background-repeat: no-repeat !important;
background-position: 0pt 0pt !important;
height: 55px !important;
width: 150px !important;
display: block !important;
}
}

/* Froogle/Google Products pages */
@-moz-document url-prefix("http://www.google.com/products?") {
#glogo * {display:none !important;}
#glogo {text-indent:-999px !important; background-position:0px -26px !important;}

}
@-moz-document url-prefix("http://www.google.com/products"), url-prefix("http://www.google.com/prdhp?") {
table, tr, td, img, tbody {
background: transparent none !important;
}
center {
background-image: url(data:image/jpeg;base64,) !important;
background-repeat: no-repeat !important;
background-position: center 0px !important;
}
#ps-logo {
visibility: hidden !important;
}

.n>table tr>td a img, .n>table tr>td img  {
visibility:hidden;
}
.n table tr>td {
background:transparent url(data:image/gif;base64,)
!important;
background-position: -60px 0px !important;
}
}
